import React from 'react';
import { FaGuitar, FaDrum, FaMicrophoneAlt } from "react-icons/fa";

const InstrumentsList = {
    GUITAR: <FaGuitar />,
    VOCAL: <FaDrum />, 
    DRUMS: <FaMicrophoneAlt />
}

export default InstrumentsList;
